import React, {Component} from 'react';
import {Container, Nav, Navbar, NavDropdown} from "react-bootstrap";

class NavBar extends Component {

    constructor(props) {
        super(props);

        this.onClickActionNavBar = this.onClickActionNavBar.bind(this);
    }


    onClickActionNavBar = (event) => {
        console.log("Action Button Clicked")
    }

    render() {
        return (
            <div>
                <Navbar bg="light" expand="lg">
                    <Container>
                        <Navbar.Brand href="#home">Airport Management System</Navbar.Brand>
                        <Navbar.Toggle aria-controls="basic-navbar-nav"/>
                        <Navbar.Collapse id="basic-navbar-nav">
                            <Nav className="me-auto">
                                <Nav.Link href="#home">Home</Nav.Link>
                                <Nav.Link href="#link">Flights</Nav.Link>
                                <NavDropdown title="Travel Agency" id="basic-nav-dropdown">
                                    <NavDropdown.Item href="#action/3.1" onClick={
                                        this.onClickActionNavBar
                                    }>Employees</NavDropdown.Item>
                                    <NavDropdown.Item href="#action/3.2">Companies</NavDropdown.Item>
                                </NavDropdown>
                            </Nav>
                        </Navbar.Collapse>
                    </Container>
                </Navbar>
            </div>
        );
    }
}

export default NavBar;
